const axios = require("axios");

  export default async (_req, res) => {

    try {
      const ret = await axios.get("https://www.fleuriland.fr/wp-json/wc/v2/orders?consumer_key=ck_8b723182d48e755debe4ab8a88190376ee40fab7&consumer_secret=cs_c7cfd6fb8fbf6211d88e210519e8e315efc1aa88")

      console.log("ok");
      res.json(ret);
    }catch(e) {
      console.log("aie");
      res.json(e)
    }

  };
